import React from 'react';
import {Route} from "react-router-dom";
import Homepage from "./containers/Homepage.js"
import logo from './logo.svg';
import './App.css';

class App extends Component {

  render()
  {
    return (
      <>
        <Route exact path ={'/'} component={Homepage}/>
      </>
    )
  }
}

export default App;
